import { Route, Redirect, Switch } from "react-router";
import CompanyProfile from "./CompanyProfile/CompanyProfile";
import CompanyCoupons from "./CompanyCoupons/CompanyCoupons";

export default function Customer() {
  const getUser = () => {
    return (
      <Switch>
        <Route path="/company/profile">
          <CompanyProfile />
        </Route>
        <Route path="/company/my-coupons">
          <CompanyCoupons />
        </Route>
        <Route path="/company/all-coupons">All the coupon in the system</Route>
        <Route path="/company">
          <Redirect to="/company/home" />
          Company home
        </Route>
      </Switch>
    );
  };
  return <div className="Customer">{getUser()}</div>;
}
